import React, { useState } from 'react';
import jsPDF from 'jspdf';
import 'svg2pdf.js';
import * as pdfjsLib from 'pdfjs-dist/build/pdf';
pdfjsLib.GlobalWorkerOptions.workerSrc = '/pdf.worker.mjs';



// Base64 encoded font data (replace these with the actual Base64 data for your fonts)
const fontMediumBase64 = '';  // Replace with the Base64 string of MatterMedium.ttf
const fontRegularBase64 = '';  // Replace with the Base64 string of MatterRegular.ttf
const fontSemiboldBase64 = '';

function dataURItoBlob(dataURI) {
  let byteString;
  if (dataURI.split(',')[0].indexOf('base64') >= 0)
    byteString = atob(dataURI.split(',')[1]);
  else
    byteString = decodeURI(dataURI.split(',')[1]);
  const mimeString = dataURI.split(',')[0].split(':')[1].split(';')[0];
  const ab = new ArrayBuffer(byteString.length);
  const ia = new Uint8Array(ab);
  for (let i = 0; i < byteString.length; i++) {
    ia[i] = byteString.charCodeAt(i);
  }
  const blob = new Blob([ab], { type: mimeString });
  return URL.createObjectURL(blob);
}

export default function Download({ format, layoutElementId = 'layout-preview' }) {
  const [fileName, setFileName] = useState('');

  // Define dimensions for each format.
  const formatDimensions = {
    '50x70cm': { width: 500, height: 700 },
    A4: { width: 595, height: 842 },
    '1080x1080': { width: 540, height: 540 },
    '1080x1920': { width: 540, height: 960 },
    '1080x1350': { width: 540, height: 675 },
    '1920x1080': { width: 960, height: 540 },
  };

  // For PDF export: remove the background image element from the clone.
  const prepareCloneForExportPDF = (clone, original) => {
    const bgImgClone = clone.querySelector('img[alt="Background"]');
    if (bgImgClone) {
      bgImgClone.remove();
    }
    clone.style.background = 'transparent';
  };

  // Wrap the clone in a container DIV for PDF export.
  const wrapCloneForPDF = (clone, width, height) => {
    const wrapper = document.createElement('div');
    wrapper.style.position = 'relative';
    wrapper.style.width = `${width}px`;
    wrapper.style.height = `${height}px`;
    wrapper.style.backgroundColor = 'transparent';
    wrapper.appendChild(clone);
    return wrapper;
  };

  // For PNG export: Replace the <img alt="Background"> with a div using the same background image styling.
  // (This function remains unchanged.)
  const enhanceCloneForPNG = (clone) => {
    const bgImg = clone.querySelector('img[alt="Background"]');
    if (bgImg) {
      let bgSrc = bgImg.src;
      if (bgImg.src.startsWith('data:image')) {
        bgSrc = dataURItoBlob(bgImg.src);
      }
      const bgDiv = document.createElement('div');
      bgDiv.style.position = 'absolute';
      bgDiv.style.top = '0';
      bgDiv.style.left = '0';
      bgDiv.style.width = '100%';
      bgDiv.style.height = '100%';
      bgDiv.style.backgroundImage = `url(${bgSrc})`;
      bgDiv.style.backgroundSize = 'cover';
      bgDiv.style.backgroundPosition = 'center';
      bgDiv.style.backgroundRepeat = 'no-repeat';
      bgDiv.style.zIndex = '-1';
      bgImg.remove();
      clone.insertBefore(bgDiv, clone.firstChild);
    }
  };

  const handleDownloadPDF = async () => {
    const layoutElement = document.getElementById(layoutElementId);
    if (!layoutElement || !formatDimensions[format]) {
      console.error('Invalid format or layout element not found.');
      return;
    }
    const { width, height } = formatDimensions[format];
    const orientation = format === '1920x1080' ? 'landscape' : 'portrait';
    const pdf = new jsPDF(orientation, 'px', [width, height]);

    // Add fonts to jsPDF.
    pdf.addFileToVFS('MatterMedium.ttf', fontMediumBase64);
    pdf.addFileToVFS('MatterRegular.ttf', fontRegularBase64);
    pdf.addFileToVFS('MatterSemibold.ttf', fontSemiboldBase64);
    pdf.addFont('MatterMedium.ttf', 'MatterMedium', 'normal');
    pdf.addFont('MatterRegular.ttf', 'MatterRegular', 'normal');
    pdf.addFont('MatterSemibold.ttf', 'MatterSemibold', 'normal');

    // *** Add the background image as a separate layer using a cover-style calculation ***
    const bgImg = layoutElement.querySelector('img[alt="Background"]');
    if (bgImg) {
      try {
        let imageType = 'JPEG';
        if (bgImg.src.startsWith('data:image/png')) imageType = 'PNG';
        else if (bgImg.src.startsWith('data:image/jpeg')) imageType = 'JPEG';
        let imgSrc = bgImg.src;
        if (bgImg.src.startsWith('data:image')) {
          imgSrc = dataURItoBlob(bgImg.src);
        }
        const img = new Image();
        img.src = imgSrc;
        await new Promise((resolve, reject) => {
          img.onload = resolve;
          img.onerror = reject;
        });
        const imgWidth = img.naturalWidth;
        const imgHeight = img.naturalHeight;
        const scaleX = width / imgWidth;
        const scaleY = height / imgHeight;
        const scale = Math.max(scaleX, scaleY);
        const scaledWidth = imgWidth * scale;
        const scaledHeight = imgHeight * scale;
        const offsetX = (width - scaledWidth) / 2;
        const offsetY = (height - scaledHeight) / 2;
        pdf.addImage(imgSrc, imageType, offsetX, offsetY, scaledWidth, scaledHeight);
      } catch (err) {
        console.error('Error adding background image to PDF:', err);
      }
    } else {
      const backgroundColor = window.getComputedStyle(layoutElement).backgroundColor || '#FFFFFF';
      pdf.setFillColor(backgroundColor);
      pdf.rect(0, 0, width, height, 'F');
    }

    const clonedElement = layoutElement.cloneNode(true);
    prepareCloneForExportPDF(clonedElement, layoutElement);
    clonedElement.querySelectorAll('.overskrift').forEach((el) => {
      el.style.transform = 'translateY(-24px)';
    });
    clonedElement.querySelectorAll('.tekst').forEach((el) => {
      el.style.transform = 'translateY(-8px)';
    });
    const layoutRect = layoutElement.getBoundingClientRect();
    const hullSVG = layoutElement.querySelector('svg:not([style*="cursor: grab"])');
    if (hullSVG) {
      const hullRect = hullSVG.getBoundingClientRect();
      const hullX = hullRect.left - layoutRect.left;
      const hullY = hullRect.top - layoutRect.top;
      try {
        await pdf.svg(hullSVG, {
          x: hullX,
          y: hullY,
          width: hullRect.width,
          height: hullRect.height,
        });
      } catch (error) {
        console.error('Error rendering hull SVG:', error);
      }
    }
    const logoSVG = layoutElement.querySelector('svg[style*="cursor: grab"]');
    if (logoSVG) {
      const logoRect = logoSVG.getBoundingClientRect();
      const logoX = logoRect.left - layoutRect.left;
      const logoY = logoRect.top - layoutRect.top;
      try {
        await pdf.svg(logoSVG, {
          x: logoX,
          y: logoY,
          width: logoRect.width,
          height: logoRect.height,
        });
      } catch (error) {
        console.error('Error rendering logo SVG:', error);
      }
    }
    clonedElement.querySelectorAll('svg').forEach((svg) => {
      if (svg !== hullSVG && svg !== logoSVG) {
        svg.remove();
      }
    });
    const cloneBoundingBox = clonedElement.getBoundingClientRect();
    if (cloneBoundingBox.height > height) {
      const scaleFactor = height / cloneBoundingBox.height;
      clonedElement.style.transform = `scale(${scaleFactor})`;
      clonedElement.style.transformOrigin = 'top left';
    }
    clonedElement.style.pageBreakAfter = 'avoid';
    const wrappedClone = wrapCloneForPDF(clonedElement, width, height);
    try {
      await pdf.html(wrappedClone, {
        x: 0,
        y: 0,
        width,
        html2canvas: { backgroundColor: null },
      });
      if (pdf.internal.pages.length > 1) {
        pdf.deletePage(2);
      }
    } catch (error) {
      console.error('Error rendering remaining content:', error);
    }
    pdf.save(`${fileName}.pdf`);
  };

  // New PNG export that reuses the PDF export pipeline to achieve the same quality.
  const handleDownloadPNG = async () => {
    // First, generate the PDF (but do not save it) using the same method as handleDownloadPDF.
    const layoutElement = document.getElementById(layoutElementId);
    if (!layoutElement || !formatDimensions[format]) {
      console.error('Invalid format or layout element not found.');
      return;
    }
    const { width, height } = formatDimensions[format];
    const orientation = format === '1920x1080' ? 'landscape' : 'portrait';
    const pdf = new jsPDF(orientation, 'px', [width, height]);

    // Add fonts to jsPDF.
    pdf.addFileToVFS('MatterMedium.ttf', fontMediumBase64);
    pdf.addFileToVFS('MatterRegular.ttf', fontRegularBase64);
    pdf.addFileToVFS('MatterSemibold.ttf', fontSemiboldBase64);
    pdf.addFont('MatterMedium.ttf', 'MatterMedium', 'normal');
    pdf.addFont('MatterRegular.ttf', 'MatterRegular', 'normal');
    pdf.addFont('MatterSemibold.ttf', 'MatterSemibold', 'normal');

    // Add background image.
    const bgImg = layoutElement.querySelector('img[alt="Background"]');
    if (bgImg) {
      try {
        let imageType = 'JPEG';
        if (bgImg.src.startsWith('data:image/png')) imageType = 'PNG';
        else if (bgImg.src.startsWith('data:image/jpeg')) imageType = 'JPEG';
        let imgSrc = bgImg.src;
        if (bgImg.src.startsWith('data:image')) {
          imgSrc = dataURItoBlob(bgImg.src);
        }
        const img = new Image();
        img.src = imgSrc;
        await new Promise((resolve, reject) => {
          img.onload = resolve;
          img.onerror = reject;
        });
        const imgWidth = img.naturalWidth;
        const imgHeight = img.naturalHeight;
        const scaleX = width / imgWidth;
        const scaleY = height / imgHeight;
        const scale = Math.max(scaleX, scaleY);
        const scaledWidth = imgWidth * scale;
        const scaledHeight = imgHeight * scale;
        const offsetX = (width - scaledWidth) / 2;
        const offsetY = (height - scaledHeight) / 2;
        pdf.addImage(imgSrc, imageType, offsetX, offsetY, scaledWidth, scaledHeight);
      } catch (err) {
        console.error('Error adding background image to PDF:', err);
      }
    } else {
      const backgroundColor = window.getComputedStyle(layoutElement).backgroundColor || '#FFFFFF';
      pdf.setFillColor(backgroundColor);
      pdf.rect(0, 0, width, height, 'F');
    }

    // Clone the layout element for export.
    const clonedElement = layoutElement.cloneNode(true);
    prepareCloneForExportPDF(clonedElement, layoutElement);
    clonedElement.querySelectorAll('.overskrift').forEach((el) => {
      el.style.transform = 'translateY(-24px)';
    });
    clonedElement.querySelectorAll('.tekst').forEach((el) => {
      el.style.transform = 'translateY(-8px)';
    });
    const layoutRect = layoutElement.getBoundingClientRect();
    const hullSVG = layoutElement.querySelector('svg:not([style*="cursor: grab"])');
    if (hullSVG) {
      const hullRect = hullSVG.getBoundingClientRect();
      const hullX = hullRect.left - layoutRect.left;
      const hullY = hullRect.top - layoutRect.top;
      try {
        await pdf.svg(hullSVG, {
          x: hullX,
          y: hullY,
          width: hullRect.width,
          height: hullRect.height,
        });
      } catch (error) {
        console.error('Error rendering hull SVG:', error);
      }
    }
    const logoSVG = layoutElement.querySelector('svg[style*="cursor: grab"]');
    if (logoSVG) {
      const logoRect = logoSVG.getBoundingClientRect();
      const logoX = logoRect.left - layoutRect.left;
      const logoY = logoRect.top - layoutRect.top;
      try {
        await pdf.svg(logoSVG, {
          x: logoX,
          y: logoY,
          width: logoRect.width,
          height: logoRect.height,
        });
      } catch (error) {
        console.error('Error rendering logo SVG:', error);
      }
    }
    clonedElement.querySelectorAll('svg').forEach((svg) => {
      if (svg !== hullSVG && svg !== logoSVG) {
        svg.remove();
      }
    });
    const cloneBoundingBox = clonedElement.getBoundingClientRect();
    if (cloneBoundingBox.height > height) {
      const scaleFactor = height / cloneBoundingBox.height;
      clonedElement.style.transform = `scale(${scaleFactor})`;
      clonedElement.style.transformOrigin = 'top left';
    }
    clonedElement.style.pageBreakAfter = 'avoid';
    const wrappedClone = wrapCloneForPDF(clonedElement, width, height);
    try {
      await pdf.html(wrappedClone, {
        x: 0,
        y: 0,
        width,
        html2canvas: { backgroundColor: null },
      });
      if (pdf.internal.pages.length > 1) {
        pdf.deletePage(2);
      }
    } catch (error) {
      console.error('Error rendering remaining content:', error);
    }
    // Instead of saving the PDF, output it as a data URI.
    const pdfDataUri = pdf.output('datauristring');

    // Now use pdfjsLib to load the PDF data and render the first page to a canvas.
    // This gives you a rasterized version of your PDF export.
    const pdfDoc = await pdfjsLib.getDocument({ data: atob(pdfDataUri.split(',')[1]) }).promise;
    const page = await pdfDoc.getPage(1);
    // Use a scale factor here to get the desired quality.
    const renderScale = 4; // Adjust as needed; using 1 here because the PDF is already high quality.
    const viewport = page.getViewport({ scale: renderScale });
    const canvas = document.createElement('canvas');
    canvas.width = viewport.width;
    canvas.height = viewport.height;
    const context = canvas.getContext('2d');
    await page.render({ canvasContext: context, viewport }).promise;
    const pngDataUrl = canvas.toDataURL('image/png');
    const link = document.createElement('a');
    link.href = pngDataUrl;
    link.download = `${fileName}.png`;
    link.click();
  };

  return (
    <div className="bg-white p-7 rounded-lg overflow-y-auto flex flex-col">
      <div className="text-lg font-medium block mb-3">Eksporter som</div>
      <div className="flex gap-2">
        <input
          type="text"
          value={fileName}
          onChange={(e) => setFileName(e.target.value)}
          placeholder="Filnavn"
          className="flex-1 py-2 px-3 bg-white border-[1px] border-black/10 resize-none rounded-md outline-none text-sm"
        />
        <button
          onClick={handleDownloadPNG}
          className="text-sm py-2 px-3 bg-black/5 border-[1px] border-transparent rounded-md hover:bg-black/10 transition-colors duration-200 select-none"
        >
          PNG
        </button>
        <button
          onClick={handleDownloadPDF}
          className="text-sm py-2 px-3 bg-black/5 border-[1px] border-transparent rounded-md hover:bg-black/10 transition-colors duration-200 select-none"
        >
          PDF
        </button>
      </div>
    </div>
  );
}